fj_bytes(S) when is_binary(S); is_list(S) ->
    B64 = << <<if C =:= $- -> $+;
                  C =:= $_ -> $/;
                  true -> C
               end>>
              || <<C>> <= iolist_to_binary(S) >>,
    base64:decode(B64).


